import tents from "../../images/tents.png";

const Contact = () => {
  return (
    <div className="">
      <form className="text-white absolute p-4 bg-slate-500 ">
      </form>
        <div>
          <label htmlFor="">First name</label>
          <input type="text" />
        </div>
      <img src={tents} alt="" className=" -z-1" />
    </div>
  );
};

export default Contact;
